        id: 10,
        desc: '<div class="pane" style="display: block;"><div><p>GrindLazer HP RC1640 H je rotaciona mašina koja nudi najveću brzinu prilikom uklanjanja oznaka i može se koristiti za uklanjanje na betonskim i asfaltnim površinama. Ova mašina koristi tri sklopa rezača za uklanjanje oznaka širine do 40 cm. RC1640 H isključuje hidraulični sistem visokog protoka.</p> <p><b>Bez tragova prilikom uklanjanja oznaka</b></p> <ul><li>Tri rotacione glave rezača uklanjaju linije bez ostavljanja&nbsp;tragova</li> <li>Nezavisno podešavanje nagiba, dubine i pritiska omogućava vrhunsku kontrolu i bez tragova oštećenja prilikom uklanjanja oznaka na širokom rasponu površina</li> </ul><p><strong>Sistem za kontrolu dubine u više tačaka</strong></p> <ul><li>Podešavanje dubine u više tačaka za preciznu kontrolu dubine</li> <li>Opružna suspenzija omogućava da sekači lebde na površini</li> </ul><p><strong>Hidraulički sistem visokog protoka</strong></p> <ul><li>Standardne brze veze omogućavaju jednostavan rad na većini hidrauličnih sistema sa velikim protokom (115 lpm/30 gpm)</li> </ul><p><b>Jobsite Tough&nbsp;Dizajn</b></p><ul><li>Okvir od čelika omogućava rad u težim sredinama</li> </ul><p><b>Univerzalni Bob-Tach®&nbsp;dodatak</b></p> <ul><li>Brzo priključivanje,&nbsp;dodatak Backplate&nbsp;omogućava povezivanje&nbsp;sa većinom opreme za klizne utovarivače</li> </ul><p><strong>Vakumski otvor za uklanjanje prašine</strong></p> <ul><li>Omogućava spajanje vakumskog sistema LazerVac za smanjenje prašine u vazduhu</li> </ul><p>&nbsp;</p><p>The GrindLazer HP RC1640 H rotary scarifier offers the highest rate of groove-free marking removal and can be used to remove markings on both concrete and asphalt surfaces. This machine uses three cutter assemblies to remove a path up to 40 cm wide. The RC1640 H operates off the vehicle’s high-flow hydraulic system.</p> <p><b>No-Groove Line Eraser</b></p><ul><li>Three rotary cutter head removes lines without leaving any grooves</li> <li>Independant adjustment for pitch, depth and pressure offers ultimate control and no-damage removal on a wide range of surfaces</li> </ul><p><b>Multi-point Depth Control System</b></p><ul><li>Multi-point depth adjustment for accurate depth control</li> <li>Spring suspension allows the cutters to float on the surface</li> </ul><p><b>High-Flow Hydraulic system</b></p><ul><li>Standard quick connections allows an easy operation off most high-flow hydraulic systems (115 lpm/30 gpm)</li> </ul><p><b>Jobsite Tough Design</b></p><ul><li>Heavy-duty all-steel frame will hold up to the harsh jobsite environment</li> </ul><p><b>Universal Bob-Tach® attachment</b></p><ul><li>Quick-Attach, tool-free Backplate connection to most skid loader equipment</li> </ul><p><b>Vacuum Port for Dust Removal</b></p><ul><li>Allows for connection of a LazerVac vacuum system for the reduction of airborne dust</li> </ul></div><div class="clear"></div></div>',
