        id: 14,
        desc: '<div class="pane" style="display: block;"> <div><p><strong>Profesionalne prednosti</strong></p> <div class="page" data-page-number="1" data-loaded="true"> <ul><li class="textLayer">Idealan prilikom renoviranja ili farbanje nove porodične kuće</li> <li class="textLayer">Kompaktan, lagan, jednostavan za upotrebu</li> <li class="textLayer">Dizna 0.019″</li></ul><p><strong>Materijali</strong></p><p>Lakovi – Akril – Prajmeri ​​- Emajli – Emulzije</p> <p><strong>Endurance™ dizajne pumpe</strong></p> <ul><li>Proveren Graco airless dizajn pumpe</li> <li>Pruža duži radni vek i pouzdane performanse</li> <li>Brz pristup za lako čišćenje ili popravku</li> </ul><p><strong>„Lagan“ dizajn</strong></p><ul><li>Offset ručka sa gumenim udobnim rukohvatom omogućava udobnog nošenja.</li> </ul><p><strong>Konstantna kontrola pritiska</strong></p> <ul><li>Jednostavan mehanički dizajn omogućava pouzdanu upotrebu duži niz godina</li> <li>Kontrola pritisak od 10 do 227</li></ul><div class="endOfContent"><strong>Hromirani, zavareni čelični okvir</strong></div> <ul><li class="endOfContent">Velika izdržljivot</li> </ul></div><div class="page" data-page-number="2" data-loaded="true"> <div class="canvasWrapper"><strong>Okretno ulazno usisno crevo</strong></div> <ul><li class="canvasWrapper">Sva aluminijumska konstrukcija je izdržljiva, lagana i otporna na rđu</li> <li class="canvasWrapper">Uklanjanje creva bez alata za čišćenje ili pristup ulaznoj kugli</li> <li class="canvasWrapper">Lako se okreće kako bi dohvatio kante sa farbom</li> </ul><div class="textLayer"></div></div><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p></div><div class="clear"></div></div>',
