        id: 38,
        desc: '<div class="woocommerce-Tabs-panel woocommerce-Tabs-panel--description panel entry-content wc-tab" id="tab-description" role="tabpanel" aria-labelledby="tab-title-description" style=""><h4>PFT G4 pametna mašina za malterisanje sa ugrađenom pumpom za vodu</h4><p>Tražite pouzdanu i efikasnu mašinu za malterisanje za vaše građevinske potrebe? Ne tražite dalje od PFT G4 Smart mašine za malterisanje, dostupno isključivo od <a href="https://www.pftplasteringmachines.com">PFT Wales</a>.</p><p>Sa svojim snažnim motorom i inovativnim sistemom upravljanja, PFT G4 Smart je vrhunsko rešenje za brzo i efikasno malterisanje u Velikoj Britaniji. Ova mašina je dizajnirana da sa lakoćom obavlja širok spektar zadataka malterisanja, zahvaljujući preciznom mešanju i mogućnosti pumpanja.</p> <p>PFT G4 Smart je takođe neverovatno lak za korišćenje, sa korisničkim interfejsom koji ga čini jednostavnim za podešavanje i rad. Njegov kompaktan dizajn i lagana konstrukcija olakšavaju transport i upotrebu na gradilištima bilo koje veličine.</p> <p>Kada kupite svoj PFT G4 Smart od<a href="https://www.facebook.com/pftwales" target="_blank" rel="noopener">PFT Wales</a>možete biti sigurni da dobijate proizvod najvišeg kvaliteta i izuzetnu korisničku uslugu. Mi smo glavni snabdevač mašina za malterisanje u Velikoj Britaniji i ponosimo se našom posvećenošću kvalitetu i zadovoljstvu kupaca.</p> <p>Pa zašto čekati? Naručite svoju PFT G4 Smart mašinu za malterisanje danas i iskusite udobnost, efikasnost i kvalitet koji samo PFT Vels može da pruži!</p><p>Pumpe za mešanje – koje se nazivaju i mašine za malterisanje ili pumpe za malter – tipa PFT G 4 su pogodne za sve gotove suve maltere na bazi gipsa, kreča i cementa kompatibilne sa mašinama. Rezervoar za materijal je odvojen od jedinice za mešanje i pumpanje. G 4, koji radi neprekidno i potpuno automatski, može se pokrenuti i dopuniti u bilo kom trenutku. Može se puniti materijalom u vrećama, ali i pomoću haube za isporuku direktno iz silosa/kontejnera ili sa haubom za ubrizgavanje i PFT SILOMAT sistemom. PFT G 4 nudi visoku transportnu snagu i razdaljinu transporta i može se kombinovati sa čitavim asortimanom PFT mašina. G 4 pametni početni model je idealan za korisnike koji treba da obrate pažnju na svoj budžet, ali bez kompromisa po pitanju kvaliteta. Pumpa za povišenje pritiska dostupna je u proširenom obimu isporuke.</p> <p>&nbsp;</p></div> <div class="woocommerce-Tabs-panel woocommerce-Tabs-panel--fields-of-application panel entry-content wc-tab" id="tab-fields-of-application" role="tabpanel" aria-labelledby="tab-title-fields-of-application" style=""> <h2 class="yikes-custom-woo-tab-title yikes-custom-woo-tab-title-fields-of-application">Primena</h2><ul style="color: rgb(76, 76, 76); --darkreader-inline-color:#b8b2a9;" data-darkreader-inline-color=""> <li style="font-weight: inherit; font-style: inherit;">Brauniranje zidova od gipsanog maltera MP75</li> <li style="font-weight: inherit; font-style: inherit;">Krečno/gipsani malter</li> <li style="font-weight: inherit; font-style: inherit;">Cementni malter OCR&nbsp; Basecoats</li> <li style="font-weight: inherit; font-style: inherit;">Izolacija</li><li style="font-weight: inherit; font-style: inherit;">Krečno-cementni malter</li> <li style="font-weight: inherit; font-style: inherit;">Render material</li><li style="font-weight: inherit; font-style: inherit;">Izolacioni malter</li> <li style="font-weight: inherit; font-style: inherit;">Obojeni malteri i lepljivi premazi</li> <li style="font-weight: inherit; font-style: inherit;">Malter za zidanje</li> <li style="font-weight: inherit; font-style: inherit;">Podna košuljica</li><li style="font-weight: inherit; font-style: inherit;">Tečno punilo</li><li style="font-weight: inherit; font-style: inherit;">Lepak i malter za ojačanje</li> </ul></div>',
