    	desc: '<div><h2>Karakteristike</h2></div> <div> <p><strong>Čist i suv kompresorski vazduh sa Airblast Aftercoolers</strong></p> <p>Kopresorska klima je neophodna&nbsp;kako bi se osiguralo&nbsp;besprekorno peskarenje i raspršivanje boje,&nbsp;kao i za alate sa komprimovanim vazduhom.</p> <p><img src="https://www.airblast.com/media/prod/f8427586221df35843c43fe77bbd8d76_2a6c106c4e3442cf6806a61aea430cf9.jpg" alt=""></p> <p>Komprimovani vazduh doprinosi boljem kvalitetu blastiranih površina jer je veći deo ulja i vode uklonjen iz vauduha.&nbsp;Komprimovani vazduh poboljšava produktivnost, olakšava održavanje i smanjuje operativne troškove.</p> <p>Najčešća kontaminacija komprimovanog vazduha je vode. Voda u obliku pare ulazi u vazdušni sistem preko ulaza kompresora i koncentruje se do zasićenja.&nbsp;Kako se hlađenje odvija nizvodno od kompresora vlaga u zasićenom vazduhu se kondezuje u vodu.</p> <p>Drugi kontaminant je ulje, koje ulazi u sistem kompresora podmazivanjem. Nekoliko litara ulja na taj način mogu ući u vazdušni sistem tokom vremena.</p> <p>Airblast oprema za komprsiju vazduha uklanja sve zagađivače i osigurava suv i čist vazduh.</p> </div>',
